import React from "react";
import Header from "./components/Header";
import { Col, Row, Container } from "./components/Grid";
import RepoList from "./components/RepoList";

const App = () => {
  return (
    
    <Container fluid>
      <Header/>
      <Row>
        <Col size="md-6 sm-12">
          <RepoList/>
        </Col>
      </Row>
    </Container>
    
  );
};

export default App;
